function fields(obj, interface) {

    if(!obj) return;

    let arr = [];

    for (let [key, value] of Object.entries(obj)) {
        if (key === 'id' || key === 'created_at' || key === 'updated_at') continue;
        let o = {
            name: key,
            label: key,
            type: 'any'
        };
        arr.push(o);
    }

    if(!interface) {
        return {
            name: 'fields',
            label: 'Fields',
            type: 'collection',
            spec: arr
        }
    }

    return arr;
}

