function record(body) {

    if(!body) return;

    let arr = [];

    body.forEach(item => {
        let obj = {
            label: "Record ID: " + item.id + ' (' + iml.formatDate(item.created_at, 'HH:mm, MMM DD YYYY') + ')',
            value: item.id
        };
        arr.push(obj);
    });

    return arr;

}

